// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>Admin Dashboard</h1>
            <ul>
                <li><Link to="/media/list">Media List</Link></li>
                <li><Link to="/media/add">Add Media</Link></li>
                <li><Link to="/client/list">Client List</Link></li>
                <li><Link to="/client/add">Add Client</Link></li>
                <li><Link to="/borrow/list">Borrow List</Link></li>
                <li><Link to="/borrow/add">Initiate Borrow</Link></li>
            </ul>
        </nav>
    );
};

export default Navbar;
